import React from 'react';
import {connect} from "react-redux";

const mapStateToProps = (state) => {
  return {
    appState: state.appState
  }
};

const Tasker = (props) => {
  return(
    <div>
      <p>Tasker</p>
    </div>
  );
};

export default connect(mapStateToProps)(Tasker);
